import Home from './Home';
import About from './About';
import Services from './Services';
import { BrowserRouter,Route,Routes } from 'react-router-dom';
function App() {
  return (
    <div >
    <BrowserRouter>
      <Routes>
        <Route path='/' exact component={Home} />
      </Routes>
    </BrowserRouter>
    <Home />

    </div>
  );
}

export default App;
